import Navbar from './components/navbar'
import './App.css';
import React, { Component } from 'react';
import Counters from './components/counters';
import { render } from 'react-dom';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar/>
        <main className="container">
          <Counters />
        </main>
      </React.Fragment>
    );
  };
}

export default App;
